import React from "react"
import NINE from "../nl_logo.png";

class Managerheader1 extends React.Component {
    render() {
        return (
            <header>
                <img className="ui right aligned header" src={NINE} alt="nineleaps"/>

                <i className="ui right aligned header" className="sign-out icon"/>
            </header>

        )
    }
}
export default Managerheader1
